import {
  Box,
  Container,
  Typography,
  Accordion,
  AccordionSummary,
  AccordionDetails,
  Paper,
  Grid,
  Divider,
} from "@mui/material";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import PersonIcon from "@mui/icons-material/Person";
import GavelIcon from "@mui/icons-material/Gavel";
import { useState, useEffect } from "react";

interface User {
  id: number;
  username: string;
  email: string;
  date_joined: string;
  is_staff: boolean;
}

const Admin = () => {
  const [users, setUsers] = useState<User[]>([]);
  const [expanded, setExpanded] = useState<string | false>(false);

  const handleChange =
    (panel: string) => (event: React.SyntheticEvent, isExpanded: boolean) => {
      setExpanded(isExpanded ? panel : false);
    };

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await fetch("http://localhost:8000/api/auth/users/");
        if (response.ok) {
          const data = await response.json();
          setUsers(data);
        }
      } catch (error) {
        console.error("Failed to fetch users:", error);
      }
    };

    fetchUsers();
  }, []);

  return (
    <Box sx={{ flexGrow: 1, p: 3, backgroundColor: "#f5f5f5" }}>
      <Container maxWidth="lg">
        <Typography variant="h4" component="h1" gutterBottom color="#1a1a1a">
          Admin Dashboard
        </Typography>

        <Grid container spacing={3}>
          {/* Users Section */}
          <Grid item xs={12} md={6}>
            <Paper sx={{ p: 2, mb: 2 }}>
              <Typography
                variant="h6"
                gutterBottom
                sx={{ display: "flex", alignItems: "center" }}
              >
                <PersonIcon sx={{ mr: 1, color: "#ff0000" }} />
                Users Management
              </Typography>
              <Divider sx={{ mb: 2 }} />
              {users.map((user) => (
                <Accordion
                  key={user.id}
                  expanded={expanded === `user-${user.id}`}
                  onChange={handleChange(`user-${user.id}`)}
                >
                  <AccordionSummary expandIcon={<ExpandMoreIcon />}>
                    <Typography>{user.username}</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                    <Box>
                      <Typography>
                        <strong>Email:</strong> {user.email}
                      </Typography>
                      <Typography>
                        <strong>Joined:</strong>{" "}
                        {new Date(user.date_joined).toLocaleDateString()}
                      </Typography>
                      <Typography>
                        <strong>Role:</strong>{" "}
                        {user.is_staff ? "Admin" : "User"}
                      </Typography>
                    </Box>
                  </AccordionDetails>
                </Accordion>
              ))}
            </Paper>
          </Grid>

          {/* Auctions Section */}
          <Grid item xs={12} md={6}>
            <Paper sx={{ p: 2 }}>
              <Typography
                variant="h6"
                gutterBottom
                sx={{ display: "flex", alignItems: "center" }}
              >
                <GavelIcon sx={{ mr: 1, color: "#ff0000" }} />
                Auctions Management
              </Typography>
              <Divider sx={{ mb: 2 }} />
              <Typography color="text.secondary">
                Auction management coming soon...
              </Typography>
            </Paper>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
};

export default Admin;
